import Header from "../../component/Header";
import { DivContent, HomeBackGround, HomeContent, Input } from "./Styles";

const App = () => {
  return (
    <>
      <Header />
      <HomeContent>
        <HomeBackGround src="./git.png" alt="img" />
        <DivContent>
          Tste
          <Input name="usuario" placeholder="Escreva o nome do usuario"/>
        </DivContent>
      </HomeContent>
    </>
  );
};

export default App;
